import React from 'react'

const Nav = () => {
    return (
        <div className="header-menu-left-aside">
            <ul>
                <li><a href="#">Home</a></li>
                 <li><a href='#'>About Katsiaryna</a></li>
            </ul>
        </div>
    )
}

export default Nav
